                return false;
            var regex = /^[a-zA-Z]{3,5}:\/\/((((\d|[1-9]\d|1\d{2}|2[0-4]\d|25[0-5])\.){3}(\d|[1-9]\d|1\d{2}|2[0-4]\d|25[0-5]))|[a-zA-Z\-_\.\d]+)(:\d{2,5})?$/;
            var valid = value.match(regex) == null ? false : true;
